export const authTrue = () => {
  return {type: 'AUTH_TRUE'};
};

export const authFalse = () => {
  return {type: 'AUTH_FALSE'};
};

export const changeUser = (text) =>{
    console.log('changing')
    return {type: 'CHANGE_USER', text}
}
